 <body class="theme-dark" style="user-select: text;">
  <h1>
   G1816 ἐξανατέλλω
  </h1>
  <h2>
   exanatéllō
  </h2>
  <p>
   <em>
    (ex-an-at-el'-lo | eks-ah-na-TEL-loh | ayks-ah-na-TALE-loh)
   </em>
  </p>
  <h3>
   Definition
  </h3>
  <p>
   from [G1537] and [G393]; to start up out of the ground, i.e., germinate; spring up.
  </p>
  <ul>
   <li>
    to make spring up, cause to shoot forth
   </li>
   <li>
    to spring up
   </li>
  </ul>
  <h3>
   See also
  </h3>
  <p>
   [G393], [G1537]
  </p>
 </body>
